tables.table_schema:
CREATE TABLE nft_collections (
    collection_id INT PRIMARY KEY,
    collection_name VARCHAR(255),
    total_nfts INT
);

CREATE TABLE nft_collection (
    nft_id INT,
    nft_name VARCHAR(255),
    owner_id INT
);

CREATE TABLE nft_owner (
    owner_id INT,
    owner_name VARCHAR(255),
    total_nfts_owned INT
);

CREATE TABLE NFT_Collections (
    id INT PRIMARY KEY,
    collection_name VARCHAR(255) NOT NULL,
    owner_id INT NOT NULL
);

CREATE TABLE NFT_Items (
    id INT PRIMARY KEY,
    item_name VARCHAR(255) NOT NULL,
    collection_id INT NOT NULL,
    price DECIMAL(10, 2) NOT NULL
);

CREATE TABLE NFT_Owners (
    id INT PRIMARY KEY,
    owner_name VARCHAR(255) NOT NULL,
    total_items_owned INT
);

CREATE TABLE NFT_Views (
    id INT PRIMARY KEY,
    view_name VARCHAR(255) NOT NULL,
    view_description TEXT
);

CREATE TABLE owners (
    owner_id INT PRIMARY KEY,
    owner_name VARCHAR(50) NOT NULL,
    location VARCHAR(100)
);

CREATE TABLE collections (
    collection_id INT PRIMARY KEY,
    collection_name VARCHAR(50) NOT NULL,
    collection_description TEXT
);

CREATE TABLE views (
    view_id INT PRIMARY KEY,
    view_name VARCHAR(50) NOT NULL,
    nft_count INT NOT NULL,
    collection_count INT NOT NULL
);
